import './App.css';
// import { render } from 'react-dom';
// import axios from 'axios';
// import { Provider } from 'react-redux';
type User = {
  face_image_base64s:Array<string>,
  id:number,
  name:string
};
type FaceImageBase64s = {
  face_image_base64s:Array<string>
};
type myState ={
  a:User
};

const initState: myState = {
  a:{
    face_image_base64s:[],
    id: 0,
    name:""
  }
}
class App extends React.Component<{},myState>{
  state:myState = initState;

  getAPI=(id:number,method:string)=>{
    const url = `/DeepHub/face_check_in/1.0.0/users/${id}`

    // axios.get(url,{
    //   headers: {
    //     'x-API-key':'deephub'
