    //   console.log(res.data);
    //   const data = res.data
    //   this.setState({
    //     a:data
    //   })
    // })
    fetch(url,{
      method:'GET',
      headers: {
        'x-API-key':'deephub'
      }
    })
    .then((response) => response.json())
    .then((data) => {
      console.log('Get:', data);
      this.userIdComfirm(3,data.face_image_base64s,'POST');
    })
  }
  userIdComfirm=(id:number,data:any,methods:string)=>{
    const obj:FaceImageBase64s = {
      "face_image_base64s":data
    }
    const url = `/DeepHub/face_check_in/1.0.0/users/${id}/face_image`

    fetch(url,{
      method: 'POST',
      headers:{
        'x-API-key':'deephub',
        'Content-Type': 'application/json'
      },
      body:JSON.stringify(obj)
    })
    .then((response) => response.json())
    .then((data) => {
      console.log('Success:', data);
    })
    .catch((error) => {
      console.error('Error:', error);
    });
  }

  UNSAFE_componentWillMount(){
    this.getAPI(2,'GET');
  }
  componentDidMount(){
    // this.getAPI(2,'GET');
    // this.userIdComfirm(3,this.state.a.face_image_base64s,'POST');
  }

  render(){
    return(
      <div className="App">
      <h1>{this.state.a.id}</h1>
      </div>
    );
  }
}

export default App;
